var bio = ["Ludwig Hornung begann seine Ausbildung sechsj\xE4hrig mit klassischen Klavierstunden und Schlagzeugunterricht, in den anschlie\xDFenden Jahren folgten zweite und erste Preise bei \u201EJugend musiziert\u201C und \u201EJugend jazzt\u201C. ", "Parallel dazu interessierte sich Ludwig Hornung f\xFCr elektronische Musikstile wie Trip Hop, Hip Hop und Breakbeat und begann im Alter von 14 Jahren, Beats und Remixes mit DJs aus dem Rhein-Main-Gebiet zu produzieren, gastierte mit diesen bei Konzerten im s\xFCddeutschen Raum und war an der Entstehung des ersten Albums des Elektro-Duos \u201EThird I Vision\u201C beteiligt, welches auch in Japan auf den Markt kam. Von 2005 bis 2006 war Ludwig Hornung Mitglied des \"Jugend Jazz Orchester Rheinland-Pfalz\", mit dem er mehrere Konzert- und Auslands-Tourneen unternahm.", "2006 begann er ein Studium als Diplommusiker im Bereich Jazz-Klavier an der Musikhochschule Stuttgart bei Prof. Paul Schwarz. W\xE4hrend dieser Zeit in Stuttgart war er Mitglied der Backingband \u201ESoulfood International\", mit der er namhafte Raggae-Musiker wie Rico Rodriguez, Derrick Morgan, Alton Ellis bei Konzerten, Festivals und Tourneen in ganz Europa begleitete.\n2008 wechselte er dann an das Jazz Institut Berlin zu Prof. Wolfgang K\xF6hler, Prof. David Friedman und Prof. Hubert Nuss, wo er im Juli 2011 sein Bachelor-Studium mit Bestnote abschloss. Parallel zum Jazz-Studium bekam Ludwig Hornung klassischen Klavierunterricht bei Prof. Susanne Gr\xFCtzmann. ", "Mit dem Dima Bondarev Quintett trat er beim Wettberwerb des Festivals \u201EJazz \xE0 Montauban\u201C in Frankreich auf, wo die Gruppe den ersten Preis gewann, einen zweiten Preis gab es auf dem \u201EJazz nad Odra\u201C-Festival in Polen, Tourneen f\xFChrten unter anderem auf das Festival \u201EJazz Bez\u201C in L\u2018viv (Ukraine), wo es zu einem gemeinsamen Fernsehauftritt mit dem Bandleader kam.\nWeitere Festivals auf denen Hornung auftrat waren die \u201EJazzopen Stuttgart\u201C, \u201EGerman Jazz Nights\u201C in Br\xFCssel, \u201EJazz Festival Lyon\u201C und das \u201EJazznachwuchsfestival Leipzig\u201C.", "Seine Hauptaktivit\xE4ten in den letzten Jahren waren vor allem die Gr\xFCndung zweier eigener Projekte: das akkustische \u201EHornung Trio\u201C mit Phil Donkin am Bass und Bernd Oezsevim am Schlagzeug, dessen erste CD \u201ESpieler\u201C im Juli 2017 bei der rennomierten Reihe \u201EJazz thing - Next Generation\u201C erscheint, sowie die Combo \u201ETriebwerk Hornung\u201C, bestehend aus Saxophon, Schlagzeug und Fender Rhodes, zusammen mit Wanja Slavin und John Schr\xF6der, die Debut-CD erschien im November 2017 bei dem schweizer Label \u201EUnit Records\u201C.\nIn beiden Bands werden ausschlie\xDFlich  Eigenkompositionen gespielt, da das Komponieren f\xFCr Ludwig Hornung seit seiner Jugend einen gro\xDFen Stellenwert einnimmt.", "In Berlin organisiert er seit 2012 eine w\xF6chentliche Session (\u201EBei Ernst\u201C), die er mit wechselnden Musikern der Berliner Jazz-Szene er\xF6ffnet", "Er spielte und konzertierte unter anderem mit Jan Leipnitz, John Schr\xF6der, Tobias Backhaus, Sebastian Merk, Mathias Ruppnig, Ivars Arutyunyan, Moritz Baumg\xE4rtner, Phil Donkin, Andreas Lang, Josh Ginsburg, Johannes Fink, Rodolfo Paccapelo, Max Mucha, Marc Muellbauer, Wanja Slavin, Felix Wahnschaffe, Finn Wiesner, Uli Kempendorff, Malte Schiller, Ben Kraef, Ronny Graupe, Paulo Cardoso, Diego Pinera, Tony Lakatos, Peter Ehwald u. v. a.", "Seine musikalischen T\xE4tigkeiten f\xFChrten ihn nach Frankreich, D\xE4nemark, Italien, Portugal, Schweden, Belgien, Tschechien, Russland, Polen, Bulgarien, \xD6sterreich, S\xFCd-Korea, in die Schweiz, die Ukraine, die Niederlande, die T\xFCrkei und in die USA.\n\n2017 erhielt Ludwig Hornung ein Stipendium des Berliner Senats."];
var reference = ["Ludwig Hornung ist einer der wenigen Menschen, die mit einer nat\xFCrlichen Virtuosit\xE4t gesegnet sind. Seine Technik ist nichts weniger als atemberaubend!", "Und mit \u201ETechnik\u201C meine ich nicht in erster Linie schnell und viel spielen k\xF6nnen \u2013das k\xF6nnen die meisten-  sondern die einzigartige singende Qualit\xE4t jedes Tones zu erzeugen und in jedem denkbaren Kontext aufrecht zu erhalten. Alles singt bei ihm, die rasenden Linien nehmen einen Ton f\xFCr Ton gefangen (\u201EEchos\u201C), die Akkorde leuchten geradezu (\u201EDer Spieler\u201C).", "Wer so singen kann, der h\xF6rt jeden Ton, den er spielt, der ist ganz und gar im Moment, der ist mit jeder Note glaubw\xFCrdig und jede Improvisation wird zur spontanen Komposition,\nder am Ende nichts mehr hinzuzuf\xFCgen ist. Es ist m\xFC\xDFig, auf einzelne St\xFCcke oder Stellen zu verweisen, denn Ludwig Hornungs Souver\xE4nit\xE4t ist omnipr\xE4sent.", "Er beherrscht die Musik und das Instrument nach Belieben und wir folgen seinen spontanen Reisen durch Eigenkompositionen und Standards der Meister (Monk\u2019s \u201EUgly Beauty\u201C, und \u201EKokolores\u201C ist nat\xFCrlich eine Verneigung vor Wayne Shorter\u2019s \u201EDolores\u201C), fasziniert an jeder Note h\xE4ngend, gespannt wohin die Reise geht, fast schon entt\xE4uscht, wenn das St\xFCck zu Ende ist.\nIch k\xF6nnte ihm stundenlang zuh\xF6ren!"];
