var trioDescription = ["Das Hornung Trio, dessen erste CD imAugust 2017 bei der rennomierten Reihe \u201EJazz thing - Next Generation\u201C ver\xF6ffentlicht werden wird, hat viele Gesichter. Mal wild, mal lyrisch, mal frei spielend, mal rhythmische Ger\xFCste auslotend, jedoch immer intensiv und um ein H\xF6chstma\xDF an Kommunikation bem\xFCht, interpretieren die drei Musiker die Kompositionen des Pianisten mit viel Energie und Verve.\nDiese bestehen zum Teil aus einfachen Melodien und geben den Musikern viel Raum und die M\xF6glichkeit, ihre jeweiligen eigenen Stimmen zu einem homogenen Gemisch zusammenwachsen zu lassen, im Vordergrund steht das Bestreben, ausdrucksstark und mit hohem innerem Engagement zu agieren.\nWer von Musik nicht nur eingelullt, sondern auch mal gefordert werden m\xF6chte, kommt hier voll und ganz auf seine Kosten.", "Ludwig Hornung - Piano, Kompositionen", "\nPhil Donkin - Bass", "\nBernd Oezsevim - Schlagzeug\n"];
var triebwerkDescription = ["Wanja Slavin, John Schr\xF6der und Ludwig Hornung bilden das \u201ETriebwerk\u201C, dessen Bestreben es ist, stets ein hohes Ma\xDF an Energie, Abwechslungsreichtum und Dichte zu erreichen, was durch die intime Bestzung unterst\xFCtzt, beziehungsweise forciert wird. \xDCberbordende, ausladende Passagen haben ebenso eine Daseinsberechtigung wie lyrische und fragile Momente; die Kommunikation untereinander steht \xFCber Allem. Stilistisch dem Jazz verschrieben, finden sich Elemente des Rock, des Drum and Bass sowie der Freien Musik zusammen zu einem homogenen Gemisch, das den H\xF6rer mal fordert, mal einlullt, jedoch nie langweilt.\nIn John Schr\xF6der, l\xE4ngst einer der wichtigsten, versiertesten und einflu\xDFreichsten Musiker der deutschen Jazzszene, und Wanja Slavin, Innovator und festes Bestandteil des deutschen Jazzgeschehens, fand Initiator und Spiritus rector Ludwig Hornung die geeigneten Weggenossen, seine Klangvortsellungen umzusetzen.\n"];
var jazzthing = ["Eine nicht so ganz \xFCbliche Besetzung bildet das Trio Ludwig Hornung, Wanja Slavin und John Schr\xF6der mit Fender Rhodes, Saxofon und Schlagzeug. Doch die erweist sich bei diesem Deb\xFCt als genau die richtige Triebfeder f\xFCr ihre sehr direkte, vorw\xE4rtstreibende Musik. Hier wird nicht nur voller Energie und Lust ausgelassen frei improvisiert, sondern Kommunikation in allen Facetten betrieben. Hornung haut oft kraftvoll rockig oder mal funky in die Tasten, entlockt seinem elektrischen Klavier aber auch zarteste Noten, zu denen Slavin lyrische Passagen spielt und Schr\xF6der mal vertr\xE4umt mal enorm rhythmisch Felle und Becken bearbeitet. Diese Musik ist derart intensiv und den so erzeugten Druck sp\xFCrt man fast k\xF6rperlich. Dann gibt es nach fast sechzig Minuten Powerplay noch einen ziemlich lustigen Hidden Track, bei dem in wunderbar satirisch \xFCberspitzten Dialogen der zwischenmenschliche Alltagswahnsinn kolportiert wird. Grandios!"];
var podium = ["Die Idee zu dieser Band gab es schon sehr lange, jetzt liegt endlich die erste CD von Ludwig Hornung (Fender Rhodes), Wanja Slavin (Saxofon) und John Schr\xF6der (Drums) vor. Ein Motor f\xFCr die Entscheidung, das zu Unrecht in den letzten Jahren zumindest im Jazz wenig pr\xE4sente Fender Rhodes wieder etwas in den Vordergrund zu r\xFCcken, war dabei zweifelsohne der innovative Umgang von Ludwig Hornung mit diesem Instrument. Und es geh\xF6rte wohl auch etwas Mut dazu, dieses E-Piano mit dem ganz speziellen warmen, glocken\xE4hnlichen Klang, das in Jazz, Funk, Soul und Fusion ab Ende der 1960er- bis Mitte der 1980er-Jahre stilpr\xE4gend war, wieder zu emanzipieren. Triebwerk Hornung beweist einmal mehr: Die ganz und gar eigenst\xE4ndige Klangfarbe des Fender Rhodes bleibt aktuell und faszinierend, trotz aller digitalen Neuerungen, und korrespondiert problemlos mit den breit angelegten Saxofonpassagen Wanja Slavins und John Schr\xF6ders raffinierten, sorgf\xE4ltig austarierten Drum-Eskapaden. Das Ergebnis ist eine \xFCberraschende, spannungsgeladene Musik zwischen Retro und Moderne. H\xF6hepunkte sind immer wieder die Zwiegespr\xE4che zwischen Ludwig Hornung und seinen kongenialen Partnern."];
